import React from 'react'
import Nav from '../components/nav'
import '../styles/base.scss'
import Sheetapi from '../config/api'
import BG from '../components/layout/bg';

class Home extends React.Component {

  constructor(props) {
    super(props);
  }

  async componentDidMount() {
    localStorage.setItem("myOauth", JSON.stringify(await Sheetapi.postSheetValues()))
  }

  render() {
    return (
      <div className="warp">
        <Nav name="main" />
        <BG />

          <div className="warp-menu" >
            <div className="menu">
              <div className="icon"></div>
              <img src="/static/department.svg" alt="icon"/>
              <h6>หน่วยงานที่เกี่ยวข้อง</h6>
              <img src="/static/" alt="icon"/>
              <h6>หน่วยงานดูแลผู้สูงอายุ</h6>
              <img src="/static/" alt="icon"/>
              <h6>เอกสารที่จำเป็น</h6>
              <img src="/static/" alt="icon"/>
              <h6>กิจกรรม</h6>

            </div>

          </div>


        <div className="warp-content" >
          <div className="content"></div>
        </div>

      </div>
    )
  }
}
export default Home
